import axios from 'axios'

export const getAllCarTypes = () => {

    return (dispatch, getState) => {
        axios.get('http://localhost:8090/api/rentacar/carType/all')
            .then(res => {
                console.log(res.data);
                dispatch({ type: 'GET_ALL_CAR_TYPES', carTypes: res.data })
            })
    }

}


